How do I update a Mongoose Model Array?<p>I am fairly new to programming so I apologize if there is a very simple answer to this question.</p>

<p>I am trying to create a simple website where users can upload multiple images and have those images be displayed somewhere else on the website. I am accomplishing this with Mongoose, Express, and Node. I am using Multer as the uploading middleware and I am also using body parser which I've heard can cause complications when used with Multer. I am using the Cloudinary API to upload and host the uploaded images.</p>

<p>Ideally, the user would select which images they want to upload, those images would be uploaded to Cloudinary, then the direct link to each image would be saved in the Mongoose Model for that particular post and then each image would be displayed using the image link that has been saved.</p>

<p>So far, I have everything working perfectly except for one issue. The issue that I am running into is when I try to push the supplied link for the uploaded image into the Mongoose Model array, I receive an error and I cannot figure out a workaround.</p>

<p>Here is the code where the images are uploaded and pushed into the array:</p>

<pre><code>var imageLength;
var newImage = new Array();
router.post("/", isLoggedIn, upload.array("image"),function(req, res){
    image: [];
    imageLength = req.files.length;
    for(var i = 0; i &lt; imageLength; i++){
        cloudinary.uploader.upload(req.files[i].path, function(result) {
            // add cloudinary url for the image to the campground object under image property
            newImage.push(result.secure_url);
            console.log(newImage[i-1]);
            console.log(req.body);
            req.body.campground.image.push(newImage[i-1]);
            console.log(req.body);
        });
    }
</code></pre>

<p>Here is the Mongoose Model for "campground":</p>

<pre><code>var mongoose = require("mongoose");

var campgroundSchema = new mongoose.Schema({
   name: String,
   image: [String],
   image_id: [String],
   description: String,
   author: {
     id: {
        type: mongoose.Schema.Types.ObjectId,
        ref: "User"
     },
     username: String
   },
   comments: [
      {
         type: mongoose.Schema.Types.ObjectId,
         ref: "Comment"
      }
   ]
});

module.exports = mongoose.model("Campground", campgroundSchema);
</code></pre>

<p>And here is the error that I receive:</p>

<pre><code>https://res.cloudinary.com/jpisani/image/upload/v1525280683/r1cs0zmjrznopot7lmu9.jpg
{ campground: 
   { name: 'g',
     description: 'g',
     author: { id: 5aaaf25986f338289129f8ea, username: 'frff' } } }
/home/ubuntu/workspace/YelpCamp/v10/routes/campgrounds.js:50
            req.body.campground.image.push(newImage[i-1]);
                                     ^

TypeError: Cannot read property 'push' of undefined
</code></pre>

<p>As you can see, the image successfully uploaded to Cloudinary and I have a direct link to that image. The issue lies in <code>console.log(req.body);</code>. There is no image property listed which prevents me from pushing the link into the image array.</p>

<p>I understand that <code>req.body</code> only contains what has been submitted by the user but I have not found a solution to this problem with any other method.</p>

<p>Here is the code for the create a new post page:</p>

<pre><code>&lt;div class="row"&gt;
    &lt;h1 style="text-align: center"&gt;Create a New Campground&lt;/h1&gt;
    &lt;div style="width: 30%; margin: 25px auto;"&gt;
        &lt;form action="/campgrounds" method="POST" enctype="multipart/form-data"&gt;
            &lt;div class="form-group"&gt;
                &lt;input class="form-control" type="text" name="campground[name]" placeholder="name"&gt;
            &lt;/div&gt;
            &lt;div class="form-group"&gt;
                &lt;label for="image"&gt;Image&lt;/label&gt;
                &lt;input type="file" id="image" name="image" accept="image/*" multiple required&gt;
            &lt;/div&gt;
            &lt;div class="form-group"&gt;
                &lt;input class="form-control" type="text" name="campground[description]" placeholder="description"&gt;
            &lt;/div&gt;
            &lt;div class="form-group"&gt;
                &lt;button class="btn btn-lg btn-primary btn-block"&gt;Submit!&lt;/button&gt;
            &lt;/div&gt;
        &lt;/form&gt;
        &lt;a href="/campgrounds"&gt;Go Back&lt;/a&gt;
    &lt;/div&gt;
&lt;/div&gt;
</code></pre>

<p>As you can see, the image upload portion of this code(found in the center) is named "image" which should make the image array in the Mongoose Model appear when I <code>console.log(req.body);</code> but it does not seem to do this.</p>

<p>If any information is required please ask, I will respond promptly. Any help would be greatly appreciated. Thanks in advance.</p>

<p><strong>Edit</strong>: A solution has been found! For anyone coming across this in the future, here is the answer to the problem.</p>

<pre><code>//create - add new campground to DB
router.post("/", isLoggedIn, upload.array("campground[image]"), async function(req, res){
    // add author to campground
    req.body.campground.author = {
        id: req.user._id,
        username: req.user.username
    };

    req.body.campground.image = [];
    for (const file of req.files) {
        let result = await cloudinary.uploader.upload(file.path);
        req.body.campground.image.push(result.secure_url);
    }

    Campground.create(req.body.campground, function(err, campground) {
        if (err) {
            return res.redirect('back');
        }
        res.redirect('/campgrounds/' + campground.id);
    });
});
</code></pre>

